import "./Course.css";

const Course = () => {
  return (
    <div className="Course">
        <h2 className="CourseHeading">Course</h2>
        <h3> * July - December 2018 *</h3>
        <h4>DAta</h4>
        <h5>at IME CADCAM Training Centre, Penang, Malaysia</h5>

        <h3> * October 2018 *</h3>
        <h4>Mastercam NC Programming</h4>
        <h5>at IME CADCAM Training Centre, Penang, Malaysia</h5>
    </div>
  );
}

export default Course;
